$(document).ready(function(){$.getJSON("../data/events.json",function(s){$.each(s,function(s,a){var t='<div class="col s12 m4"><div class="card-panel"><h4 class="card-title name">'+a.name+'</h4><br><p class="type">Type:'+a.type+'</p><p class="host">Host:'+a.host+'</p><p class="start-date">Start: '+a.start_date+'</p><p class="end-date">End: '+a.end_date+'</p><p class="guests">Guests:</p><ul class="guest-list" id='+a.id+'></ul><p class="location">Location: '+a.location+'</p><p class="message">Message: '+a.message+"</p></div></div>";$("#events").append(t);var e="#"+a.id;$.each(a.guest_list,function(s,a){var t='<li class="guest">'+a+"</li>";$(e).append(t)})})})});